Глава российской делегации на климатической конференции ООН извинился за действия России в Украине

Олег Анисимов сделал это на закрытой части мероприятия, сообщает несколько источников AFP. Однако Анисимов подтвердил это агентству, добавив, что выражает личное мнение, а не российской делегации.

@news_echo

⚡️Лукашенко позвонил Зеленскому, они оба договорились, что украинская и российская делегация встретятся на украинско-белорусской границы без предварительных условий, — офис Зеленского

Белорусский президент также взял ответственность за то, чтобы в это время белорусские самолеты, вертолеты и ракеты останутся на земле.

@news_echo

Медведев прокомментировал санкции против членов Совбеза Росси:

• Это хорошая возможность восстановить ряд важных институтов для предотвращения особо тяжких преступлений в стране типа смертной казни;

• Запреты не изменят решение о проведении военной операции по защите Донбасса;

• Ни я, ни моя семья не имеют имущества или счетов за рубежом;

• Россия ответит на санкции. Если Запад заморозит активы россиян и российских компаний, активы иностранцев и иностранных компаний в России тоже будут заморожены

Главное из вечерней речи Байдена: 

• Путин — агрессор, он выбрал войну.  Путин хочет восстановить Советский Союз;

• Мы ограничим для российского бизнеса возможность проводить операции в долларах, евро и йенах. Вводятся санкции против ВТБ и еще трех госбанков;

• Новые санкции ограничивают экспорт высокотехнологичной продукции в Россию

• Отключение России от SWIFT остается одним из вариантов, но сейчас эту позицию не разделяет Евросоюз.

• Войска США не будут участвовать в конфликте на Украине, но если Россия атакует какую-либо страну НАТО, США будут готовы воевать;

• Байден готов ввести санкции против Путина лично, но не ответил на вопрос, почему он не стал это делать прямо сейчас.

‼️Песков:

• "Украину в идеале нужно освободить, зачистить от нацистов";
• Смена режима на Украине — это вопрос выбора украинского народа;
• По словам Пескова, россияне поддерживают спецоперацию по демилитаризации Украины не меньше, чем признание ДНР и ЛНР;
• Слово "оккупация" Песков призвал не употреблять;
• "Почему бы и нет?", — ответил Песков на вопрос о возможных переговорах Путина и Зеленского.
